import React from 'react'
import PatientSelector from '../components/PatientSelector'

const PatientList = ({patientList, onClickFunction}) => {
    cardArray = patientList.map((patient, i) => {
        return (
            <PatientSelector 
                key={i} 
                patient={patient} 
                onClick={onClickFunction} 
            />
        )
    });

    return (
        <div id='patList'>
            {this.cardArray}
        </div>
    )
}

export default PatientList;
